{"reasoning":"Ground truth bug involves a physics problem: when the player walks on the boat, the boat itself is pushed and slides forward unnaturally. The key element is the interaction between the character’s movement and the boat, causing boat displacement.

Generated report describes a visual/physics mismatch where the boat’s hull visually clips or sinks into the water. It does not mention any player interaction or the boat being propelled by character movement; it only notes improper floating/ rendering.

Because the generated report lacks the crucial symptom (boat shifts when player walks on it) and instead focuses on static clipping, it refers to a different issue.","match":false}

{"reasoning":"Ground truth: an NPC becomes lodged on the edge of a platform, suspended in mid-air and oriented sideways, then slowly slips off. The key points are (1) stuck at the edge, not inside the geometry, (2) briefly hovering before gravity makes it fall.

Generated report: describes a clipping problem where the character sinks through or is embedded in the floor/platform, potentially floating inside level geometry. The emphasis is on passing THROUGH the surface rather than being perched on its edge.

These are different failure modes: edge-stuck vs floor-clipping. No mention of sideways orientation or hovering at edge in the generated report, and the ground truth does not mention penetrating the platform. Therefore they are not the same bug.","match":false}

{"reasoning":"The ground truth bug concerns an NPC’s character mesh becoming distorted while it lies on the roof of a moving car. The problem is visual deformation of the NPC model that increases as the car moves.

The generated report instead describes the vehicle itself clipping through the ground and sidewalk, implying collision/physics issues with the environment. It does not mention any NPC, mesh deformation, or behavior tied to a character on the roof.

Because the symptoms, affected object (NPC vs. vehicle/environment), and type of issue (mesh distortion vs. clipping into terrain) differ, they do not refer to the same underlying bug.","match":false}

{"reasoning":"The ground truth bug concerns an NPC that vanishes (is removed from the scene) after the player shoots them while they are climbing through a window. Key elements: action – being shot; context – climbing through an arched window; symptom – NPC disappears. 

The generated report talks about a character’s head clipping through a wall and a helmet floating separately, indicating a visual clipping/rendering problem. There is no mention of shooting, climbing a window, or the NPC disappearing entirely. The symptoms and context are completely different.

Therefore, the generated bug report does not describe the same underlying issue as the ground truth description.","match":false}
